import React, {useState, useEffect} from 'react';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import { Rate } from 'antd';
import {ReviewButton} from './ShowPost';
import { ArrowLeftOutlined } from '@ant-design/icons';
const ReviewWrite=()=> {
  
    const [currentValue, setCurrentValue] = useState(0)
    
    return (
      <>
        <ArrowLeftOutlined />
        <h4>ReactJS Ant-Design Rate Component</h4>
        <ReviewButton style={{width:'auto', height:'auto',textAlign:'center', fontSize:'12px'}}type="primary">완료</ReviewButton>
        <Rate allowHalf onChange={(value) => {
          setCurrentValue(value)
        }} value={currentValue} style={{color:'#EBCAFD'}}/> <br />
        Current Rating: {currentValue}
        
      </>
    );
  }

export default ReviewWrite;
